import Stadium from "./Stadium";

const stadiums = [
    {id: 1, name: "", city: "", capacity: "", image: ""},
]

function Stadiums() {
    return (
        <div className="StadiumsWrapper">
            {stadiums.map(elem => <Stadium key={elem.id}
                                           id={elem.id}
                                           name={elem.name}
                                           city={elem.city}
                                           capacity={elem.capacity}
                                           image={elem.image}/>)}
        </div>
    );
}

export default Stadiums;
